const LOCK_ENUM = {
    "LOCK": 1,
    "UNLOCK": 0    
  }

  export function isLocked(data){
    if (!data && typeof data !== 'number') {
      return false
    }

    if (typeof data === 'number') {
      return data === LOCK_ENUM.LOCK
    }

    if (typeof data === 'object') {
      return data['fiscal_notification_lock'] === LOCK_ENUM.LOCK
    }
    
    return false
  }

  export default LOCK_ENUM;
